import React, { useContext } from 'react';
import UserContext from '../../context/UserContext';

function Topbar() {
  const { username } = useContext(UserContext);

  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
        <li>{username}</li>
      </ul>
    </nav>
  );
}

export default Topbar;
